    return (
        <div className={s.postsBlock}>
          <h3>My post</h3>
          <div>
            <div>
              <textarea></textarea>
            </div>
            <div>
              <button>Add post</button>
            </div>
          </div>
          <Post message="Hi, how are you?" likesCount="15"/>
          <Post message="It's my first post" likesCount="20"/>
          </div>
    )  
};

export default MyPosts;
